def take_screenshot_and_save(title, save_path):
    try:
        window = gw.getWindowsWithTitle(title)[0]
        if window:
            window.activate()
            window.restore()
            time.sleep(0.5)
            screenshot = pyautogui.screenshot(
                region=(window.left, window.top, window.width, window.height))
            screenshot.save(save_path)
            return save_path
        else:
            return None
    except Exception as e:
        print(f"오류: {e}")
        return None


def extract_text_by_area(img, area):
    x_offset, y_offset, width, height = area
    cropped_img = img[y_offset:y_offset+height, x_offset:x_offset+width]
    gray = cv2.cvtColor(cropped_img, cv2.COLOR_BGR2GRAY)

    results = pytesseract.image_to_data(
        gray, config='--psm 11', lang='kor', output_type=pytesseract.Output.DICT)
    texts = []
    for i in range(len(results['text'])):
        if int(results['conf'][i]) > 60:
            x, y, w, h = results['left'][i], results['top'][i], results['width'][i], results['height'][i]
            texts.append(results['text'][i])
            cv2.rectangle(cropped_img, (x, y), (x + w, y + h), (0, 255, 0), 2)

    return texts, cropped_img


def click_in_window(window, x, y):
    if window:
        abs_x = window.left + x
        abs_y = window.top + y
        pyautogui.moveTo(abs_x, abs_y)
        pyautogui.click(abs_x, abs_y)


def player_button_action(player_index, return_mouse=True):
    initial_mouse_x, initial_mouse_y = pyautogui.position()  # 현재 마우스 위치 저장
    # print(f"Reporting player at index {player_index}")
    try:
        window = gw.getWindowsWithTitle(LOL_WINDOW_TITLE)[0]
        if return_mouse:
            if window.isMinimized:
                window.restore()
            window.activate()
            time.sleep(0.1)  # 활성화되고 나서 잠시 대기

        # 플레이어 신고 버튼 클릭
        position = REPORT_BUTTON_POSITIONS[player_index]
        click_in_window(window, position[0], position[1])

        # 옵션 선택
        for i, (option, var) in enumerate(OPTIONS.items()):
            # print(f"Option {option}: {var.get()}")
            if var.get():  # 옵션이 선택되었으면
                option_position = REPORT_OPTION_POSITIONS[i]
                click_in_window(window, option_position[0], option_position[1])

        # 모든 옵션이 선택된 후 '신고 완료' 버튼 클릭
        final_position = REPORT_OPTION_POSITIONS[-2]  # 신고 완료 버튼의 위치
        click_in_window(window, final_position[0], final_position[1])
        final_position = REPORT_OPTION_POSITIONS[-1]  # 신고 완료 버튼의 위치
        click_in_window(window, final_position[0], final_position[1])

    except Exception as e:
        print(f"오류: {e}")
    finally:
        if return_mouse:
            window2 = gw.getWindowsWithTitle(REPORT_WINDOW_TITLE)[0]
            if window2.isMinimized:
                window2.restore()
            window2.activate()
            # 마우스를 원래 위치로 복귀
            pyautogui.moveTo(initial_mouse_x, initial_mouse_y)


def create_report_options(window):
    options_frame = tk.Frame(window)
    options_frame.pack(side=tk.TOP, fill=tk.X)
    first_row = tk.Frame(options_frame)
    second_row = tk.Frame(options_frame)
    first_row.pack(fill=tk.X)
    second_row.pack(fill=tk.X)
    global OPTIONS
    OPTIONS = {
        "부정적인 태도": tk.BooleanVar(),
        "욕설": tk.BooleanVar(),
        "탈주/자리비움": tk.BooleanVar(),
        "의도적으로 죽음": tk.BooleanVar(),
        "혐오 발언": tk.BooleanVar(),
        "부정 행위": tk.BooleanVar(),
        "부적절한 이름": tk.BooleanVar()
    }
    option_keys = list(OPTIONS.keys())
    half_point = len(option_keys) // 2
    for text in option_keys[:half_point]:
        tk.Checkbutton(first_row, text=text,
                       variable=OPTIONS[text]).pack(side=tk.LEFT)

    for text in option_keys[half_point:]:
        tk.Checkbutton(second_row, text=text,
                       variable=OPTIONS[text]).pack(side=tk.LEFT)


def setup_player_frame(window, team_vars, team_checks, side, team_name, start_index):
    frame = tk.Frame(window, padx=10, pady=10, relief='sunken')
    frame.pack(side=side, fill=tk.BOTH, expand=True)
    tk.Label(frame, text=team_name).pack()
    for i, var in enumerate(team_vars):
        player_frame = tk.Frame(frame)
        player_frame.pack(fill=tk.X)
        tk.Checkbutton(player_frame, variable=team_checks[i]).pack(
            side=tk.LEFT)
        tk.Label(player_frame, textvariable=var).pack(side=tk.LEFT)
        idx = i + start_index
        # Ensure lambda captures current index value correctly
        report_button = tk.Button(
            player_frame, text="신고", command=lambda idx=idx: player_button_action(idx))
        report_button.pack(side=tk.RIGHT)


def create_gui():
    def batch_report_action():  # !일괄 신고 버튼
        initial_mouse_x, initial_mouse_y = pyautogui.position()
        window = gw.getWindowsWithTitle(LOL_WINDOW_TITLE)[0]
        if window.isMinimized:
            window.restore()
        window.activate()
        time.sleep(0.1)  # 활성화되고 나서 잠시 대기
        for i, (check, var) in enumerate(zip(team1_checks + team2_checks, team1_vars + team2_vars)):
            if check.get():
                player_index = i
                player_button_action(player_index, return_mouse=False)
        window2 = gw.getWindowsWithTitle(REPORT_WINDOW_TITLE)[0]
        if window2.isMinimized:
            window2.restore()
        window2.activate()
        # 마우스를 원래 위치로 복귀
        pyautogui.moveTo(initial_mouse_x, initial_mouse_y)

    def recognize_players():  # !챔피언 이름 인식
        save_path = "screenshot.png"
        if take_screenshot_and_save(LOL_WINDOW_TITLE, save_path):
            img = cv2.imread(save_path)
            current_resolution = (gw.getWindowsWithTitle(LOL_WINDOW_TITLE)[0].width,
                                  gw.getWindowsWithTitle(LOL_WINDOW_TITLE)[0].height)
            recognition_areas = POSITIONS_BY_RESOLUTION[current_resolution]["champion_recognition_areas"]
            team1_texts = [''.join(extract_text_by_area(img, area)[0])
                           for area in recognition_areas[:5]]
            team2_texts = [''.join(extract_text_by_area(img, area)[0])
                           for area in recognition_areas[5:10]]
            for i in range(TEAM_PLAYER_COUNT):
                team1_vars[i].set(team1_texts[i])
                team2_vars[i].set(team2_texts[i])
            window2 = gw.getWindowsWithTitle(REPORT_WINDOW_TITLE)[0]
            if window2.isMinimized:
                window2.restore()
            window2.activate()
        try:
            os.remove(save_path)
            print("임시 이미지 파일 삭제 완료.")
        except OSError as e:
            print(f"파일 삭제 중 오류 발생: {e}")

    #! 윈도우 생성
    window = tk.Tk()
    window.title("신고하자")

    #! 변수
    team1_vars = [tk.StringVar(value=f"플레이어{i+1}")
                  for i in range(TEAM_PLAYER_COUNT)]
    team2_vars = [tk.StringVar(value=f"플레이어{i+1}")
                  for i in range(TEAM_PLAYER_COUNT)]
    team1_checks = [tk.BooleanVar() for _ in range(TEAM_PLAYER_COUNT)]
    team2_checks = [tk.BooleanVar() for _ in range(TEAM_PLAYER_COUNT)]

    #! 신고 항목
    create_report_options(window)

    #! 팀 목록
    setup_player_frame(window, team1_vars, team1_checks, tk.LEFT, "우리팀", 0)
    setup_player_frame(window, team2_vars, team2_checks,
                       tk.LEFT, "상대팀", TEAM_PLAYER_COUNT)

    #! 일괄 신고 버튼
    batch_report_button = tk.Button(
        window, text="일괄 신고", command=batch_report_action)
    batch_report_button.pack(fill=tk.X)

    #! 챔피언 이름 인식 버튼
    tk.Button(window, text="인식", command=recognize_players).pack()

    #! 해상도를 표시할 변수
    resolution_var = tk.StringVar(value="해상도: -")
    resolution_label = tk.Label(window, textvariable=resolution_var)
    resolution_label.pack()
    get_resolutions(resolution_var)
    tk.Button(window, text="해상도 재설정",
              command=lambda resolution_var=resolution_var: get_resolutions(resolution_var)).pack()

    icon_base64 = """
   
    """

    icon32 = tk.PhotoImage(data=icon_base64)

    window.iconphoto(False, icon32)
    window.mainloop()


def get_resolutions(resolution_var):
    resolution = (1600, 900)
    try:
        lol_window = gw.getWindowsWithTitle(LOL_WINDOW_TITLE)[0]
        resolution = (lol_window.width, lol_window.height)
        resolution_var.set(f"해상도: {resolution[0]} x {resolution[1]}")
    except IndexError:
        resolution = (1600, 900)

    # 해상도 업데이트
    if resolution in POSITIONS_BY_RESOLUTION:
        global REPORT_BUTTON_POSITIONS, REPORT_OPTION_POSITIONS
        positions = POSITIONS_BY_RESOLUTION[resolution]
        REPORT_BUTTON_POSITIONS = positions["report_button_positions"]
        REPORT_OPTION_POSITIONS = positions["report_option_positions"]
    else:
        print("지원하지 않는 해상도입니다.")


def follow_lol_window():
    while True:
        try:
            lol_window = gw.getWindowsWithTitle(LOL_WINDOW_TITLE)[0]
            report_window = gw.getWindowsWithTitle(REPORT_WINDOW_TITLE)[0]

            # League of Legends 윈도우의 오른쪽에 위치시키기
            new_x = lol_window.left + lol_window.width
            new_y = lol_window.top

            # REPORT_WINDOW_TITLE 윈도우 위치 조정
            report_window.moveTo(new_x, new_y)

        except IndexError:
            # print(f"{lol_window_title} 창을 찾을 수 없습니다.")
            continue

        time.sleep(0.05)  # 0.05초 간격으로 위치를 확인


def main():
    gui_thread = threading.Thread(target=create_gui)
    gui_thread.start()
    time.sleep(2)
    follow_thread = threading.Thread(target=follow_lol_window, daemon=True)
    follow_thread.start()


if __name__ == "__main__":
    main()
